import { KEY_DOWN } from '../actions';

const INITIAL_STATE = '';

const currentWord = (state = INITIAL_STATE, actions) => {
  switch (actions.type) {
  case KEY_DOWN:
    console.log(actions.key);
    return (actions.key);
  default:
    return state;
  }
};

export default currentWord;
